hold on;
plot(data_0(:,1),data_0(:,2),'ok');


xlim([0,3])
ylim([0.8,4])
colorbar


print(figure1,'-dpdf','pcolor_bug.pdf');
matlab2tikz('figurehandle',figure1,'filename','pcolor_bug.tikz' ,'showInfo', false,'height', '\figureheight', 'width', '\figurewidth');




